var foulsCommittedHome = [];
var foulsSufferedHome = [];
var foulsCommittedAway = [];
var foulsSufferedAway = [];
test.events.forEach(function(e, i, a) {
    if (e.team.teamLocationType.name == "away") {
        e.teamStats.forEach(function(el) {
            foulsCommittedAway.push(el.foulsCommitted);
            foulsSufferedAway.push(el.foulsSuffered)
        });
    } else {
        e.teamStats.forEach(function(el) {
            foulsCommittedHome.push(el.foulsCommitted);
            foulsSufferedHome.push(el.foulsSuffered)
        });
    }
});

var w = Math.max(document.documentElement.clientWidth, window.innerWidth || 0);

var h = Math.max(document.documentElement.clientHeight, window.innerHeight || 0);

var margin = {"left": 60, "right": 60, "top": 60, "bottom": 60};

var width = w * 0.75 - margin.left - margin.right,
    height = h * 0.8 - margin.top - margin.bottom;

var svg = d3.select("body").append("svg")
    .attr("width", width + margin.left + margin.right)
    .attr("height", height + margin.top + margin.bottom)
    .append("g")
    .attr("transform", "translate(" + margin.left + "," + margin.top + ")");

var x = d3.scale.linear()
    .domain([0, Math.max(foulsCommittedHome.length, foulsCommittedAway.length)])
    .range( [0, width] );

var y = d3.scale.linear()
    .domain([0, Math.max(d3.max(foulsCommittedAway), d3.max(foulsCommittedHome))])
    .range( [height, 0] );

var xAxis = d3.svg.axis()
    .scale( x )
    .ticks(Math.floor(Math.max(foulsCommittedAway.length/2, foulsCommittedHome.length/2)))
    .orient( "bottom" );

var yAxis = d3.svg.axis()
    .scale( y )
    .orient( "left" );

var color = d3.scale.category10();

var scale = d3.scale.linear()
    .domain( [0, Math.max( foulsCommittedHome.length, foulsSufferedHome.length )] )
    .range();


var line = d3.svg.line()
    .x(function(d, i) { return x(i); })
    .y(function(d) { return y(d); })
    .interpolate("basis");

svg.append("g")
    .attr("class", "axis")
    .attr("transform", "translate(0," + height + ")")
    .call(xAxis);

svg.append("g")
    .attr("class", "axis")
    .call(yAxis)
    .append("text")
    .attr("transform", "rotate(-90)")
    .attr("y", 6)
    .attr("dy", ".71em")
    .style("text-anchor", "end")
    .text("Fouls Committed");

